Former Norwegian porn star, Aylar Lie was born in 1984 as Sharareh Dianati in Tehran (Iran) and brought, when two years old, to Norway to be raised by Norwegian foster parents. In 2002, she gained celebrity status under the pseudonym Diana as a pornographic actress. She competed at the Miss Norway pageant in 2004, but was disqualified from the contest when it was found she had starred in adult films. Candidates to the pageant must not have been pictured naked in any commercial production or publication. Her adult film career has made her the target of much criticism and even some death threats from her homeland Iran.

